import React from 'react'



function AddCard({studyDeck}){
  let result
  if(studyDeck!==undefined){
    result=(
      <div className={"container"}>
        <div className={"row"}>
          <h2>Not Enough Cards</h2>
          <p className={"col-12"}>You need atleast 3 cards. You have {studyDeck.cards.length} cards.</p>
          <button className={"btn btn-primary col-2"}>Add Card</button>
        </div>
      </div>
      )
  }
  return result;
}


export default AddCard;
